import { Container, Icon } from '@material-ui/core';
import CopyrightIcon from '@material-ui/icons/Copyright';
import React, { Component, useState } from 'react';
import IconCpf from '@material-ui/icons/PermIdentity';
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';
import { InputGroup, InputGroupAddon, InputGroupText } from 'reactstrap';
import { Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem, NavbarText } from 'reactstrap';
import logoLogin from "./desenho/Logo.png"
import './login_membro_css/membro.css';
import IconeConSenha from '@material-ui/icons/Lock';

class Login_membro extends Component {
  render() {
    return (
      <div>
        <Navbar id="nav_login">
          <Nav id="nav_link_login">
            <NavItem><img src={logoLogin} id="logo_login"></img></NavItem>
            <NavLink className="alignItems">Login</NavLink>
            <NavItem >Inicio</NavItem>
          </Nav>
        </Navbar>
        
        <Container>
          <div className="row">
            <Form>
              <FormGroup className="col-xs-12 col-md-12 col-sm-12 col-lg-12">

              </FormGroup >
              <FormGroup className="col-xs-12 col-md-12 col-sm-12 col-lg-12">
                <InputGroup>
                  <InputGroupAddon addonType="prepend">
                    <InputGroupText className="esc">
                      <i><IconCpf /></i>
                    </InputGroupText>
                  </InputGroupAddon>
                  <Input type="text" name="cpf_login" id="cpf_login" placeholder="Digite Seu Cpf"></Input>
                </InputGroup>
              </FormGroup>
            </Form>
          </div>
        </Container>
        <Navbar id="nav2_login" >
          <p id="f1">
            <p></p>
            <CopyrightIcon /> 2020-2021-Central Cidadã |Todos os Direitos Reservados
            <p id="f2">É proibido a reprodução total ou parcil de qualquer conteúdo deste site.</p>
            <p> </p>
          </p>
        </Navbar>
      </div>
    );
  }
}

export default Login_membro;
